import React, {Component} from 'react';
//Components
import Navbar from './../navigation/Navbar';
import Switch from './../sas/Deconnexion';


class Header extends Component {
  render() {
    return (
      <header className="container row">
        <Navbar />
        <Switch />
      </header>
    )
  }
}

export default Header;
